  float x = mod(vertexId, across);
  float y = floor(vertexId / across);

  float u = x / (across - 1.);
  float v = y / (across - 1.);



  float xoffset = (sin(time+ y *0.1)*0.3);
  float yoffset = (cos(time+ x *0.1)*0.9);

