  float vy = v * 2. - 1. ;


  gl_Position = vec4(ux, vy, 0, 1);
  gl_PointSize = 10.0;
  gl_PointSize *= 15.0 / across;
  gl_PointSize *= resolution.x / 600.0 *   (((sin(0.6*time) + 1.0) / 2.0))+0.5;

